import{_ as t,c as a,o as e,V as d}from"./chunks/framework.249fa23d.js";const l=JSON.parse('{"title":"墨干和GNU TeXmacs的区别","description":"","frontmatter":{},"headers":[],"relativePath":"zh/guide/Mogan_versus_TeXmacs.md","filePath":"zh/guide/Mogan_versus_TeXmacs.md","lastUpdated":1703918282000}'),c={name:"zh/guide/Mogan_versus_TeXmacs.md"},s=d('<h1 id="墨干和gnu-texmacs的区别" tabindex="-1">墨干和GNU TeXmacs的区别 <a class="header-anchor" href="#墨干和gnu-texmacs的区别" aria-label="Permalink to &quot;墨干和GNU TeXmacs的区别&quot;">​</a></h1><h2 id="产品定位" tabindex="-1">产品定位 <a class="header-anchor" href="#产品定位" aria-label="Permalink to &quot;产品定位&quot;">​</a></h2><p>墨干是自由的理工套件，包含墨砚、墨码、墨板三大组件。其中墨砚是GNU TeXmacs发行版之一，其定位和GNU TeXmacs一致，都是自由的科技编辑平台。</p><p>墨砚作为GNU TeXmacs的发行版，在使用体验上尽可能和GNU TeXmacs保持一致，是由不同团队发行的同一类产品。墨码和墨板则是基于GNU TeXmacs排版引擎和结构化编辑器的全新的产品。</p><p>本文着重强调墨砚和GNU TeXmacs这两个同类产品的区别：</p><h2 id="texmacs-home-path" tabindex="-1">TEXMACS_HOME_PATH <a class="header-anchor" href="#texmacs-home-path" aria-label="Permalink to &quot;TEXMACS_HOME_PATH&quot;">​</a></h2><table><thead><tr><th>操作系统</th><th>墨砚</th><th>GNU TeXmacs</th></tr></thead><tbody><tr><td>Linux</td><td><code>$XDG_DATA_HOME/XmacsLabs</code></td><td><code>$HOME/.TeXmacs</code></td></tr><tr><td></td><td><code>$HOME/.local/share/XmacsLabs</code></td><td></td></tr><tr><td>macOS</td><td><code>$HOME/Library/Application Support/XmacsLabs</code></td><td><code>$HOME/.TeXmacs</code></td></tr><tr><td>Windows</td><td><code>%APPDATA%\\XmacsLabs</code></td><td><code>%APPDATA%\\TeXmacs</code></td></tr><tr><td></td><td><code>C:\\Users\\用户名\\AppData\\Roaming\\XmacsLabs</code></td><td><code>C:\\Users\\用户名\\AppData\\Roaming\\TeXmacs</code></td></tr></tbody></table><blockquote><p>为什么：不同的路径是为了在系统上可以同时安装墨砚和GNU TeXmacs，另外Linux和macOS的路径更改是为了符合Linux和macOS相关标准。</p></blockquote>',8),o=[s];function r(m,_,n,h,i,T){return e(),a("div",null,o)}const X=t(c,[["render",r]]);export{l as __pageData,X as default};
